import Header from './Components/Header';
import Main from './Components/Main';
import Nav from './Components/Nav';

function App() {
  return (
    <div id='Trav'>
      <Header/>
      <div>
      <Nav/>
      <Main/>
      </div>
    </div>
  );
}

export default App;
